import Expenses from "./components/Expenses/Expenses";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Wash",
      amount: 22.63,
      date: new Date(2023, 5, 12)
    },
    {
      id:"e2",
      title: "Amex Gold Card Fee",
      amount :"250",
      date: new Date(2023,5, 10)
    }
  ];
  return (
    <div>
      <h2>Welcome To ECE 459 Learning REACT.JS FOR Engineers!</h2>
      <Expenses items = {expenses}/>
    </div>
  );
}

export default App;
